import { Box, Button, Header, Heading, Text, Tab, Tabs,Form, FormField, TextInput, DateInput, Select, Grommet } from 'grommet';
import { Hpe, Previous } from 'grommet-icons';
import React, { useState } from 'react';
import {useHistory} from 'react-router-dom';
import Foooter from './Foooter';

function Dashboard() {

  let history = useHistory();

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  const [module2, setModule2] = useState({
      Device_Shipment_By: "",
      Device_Received_Date: "",
      Device_Challan_No: "",
      Device_Challan_Date: ""
  });

  const inputEvent = (e) => {
      console.log(e.target.value);
      console.log(e.target.name);

      const {name, value} = e.target;
      setModule2((preValue)=> {
          console.log(preValue);
          return{
              ...preValue,
              [name]:value,
          };
      })
  }

  return(
      <>
      <Grommet theme={theme}>
      <Header background="brand">
          <Box direction="row" gap="small" pad="medium">
              <Hpe color="White"/>
              <Text weight="bold">HPE</Text>
              <Text>Console</Text>
          </Box>
      </Header>  
      
      <Box alignSelf="center"  border={{ color: 'brand', size: 'medium' }} >
        <Box pad="small">
            <Button icon={<Previous />} alignSelf="start" onClick={() => history.goBack()}/>
        </Box>
        <Heading margin={{left: 'medium'}} >Asset Tracker</Heading>

        <Box direction="row" alignSelf="center" pad="medium"> 
            <Text>Hello , I'm Dashboard</Text>
        </Box>
      </Box>
      <Foooter />
    </Grommet>
  </>
  );
}

export default Dashboard;
